%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0433\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u0439<\/a> \u0432\u043e\u0438\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%B4%D0%B8%D0%BF%D0%BF%D0%B8%D0%B4\" title=\"\u0424\u0438\u0434\u0438\u043f\u043f\u0438\u0434\">\u0424\u0438\u0434\u0438\u043f\u043f\u0438\u0434<\/a> \u043f\u0440\u043e\u0431\u0435\u0436\u0430\u043b \u043e\u0442 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B0%D1%84%D0%BE%D0%BD_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u041c\u0430\u0440\u0430\u0444\u043e\u043d (\u0433\u043e\u0440\u043e\u0434)\">\u041c\u0430\u0440\u0430\u0444\u043e\u043d<\/a> \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B8%D0%BD%D1%8B\" title=\"\u0410\u0444\u0438\u043d\u044b\">\u0410\u0444\u0438\u043d<\/a>, \u043f\u0440\u0438\u043d\u0451\u0441 \u0432\u0435\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9C%D0%B0%D1%80%D0%B0%D1%84%D0%BE%D0%BD%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041c\u0430\u0440\u0430\u0444\u043e\u043d\u0435\">\u043e \u043f\u043e\u0431\u0435\u0434\u0435 \u0433\u0440\u0435\u043a\u043e\u0432 \u043d\u0430\u0434 \u043f\u0435\u0440\u0441\u0430\u043c\u0438<\/a>&#160;\u2014 \u00ab\u041b\u0438\u043a\u0443\u0439\u0442\u0435! \u041c\u044b \u043f\u043e\u0431\u0435\u0434\u0438\u043b\u0438\u00bb \u0438 \u0443\u043c\u0435\u0440. \u041a\u043e\u0433\u0434\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896 \u0433\u043e\u0434\u0443<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B8%D0%BD%D1%8B\" title=\"\u0410\u0444\u0438\u043d\u044b\">\u0410\u0444\u0438\u043d\u0430\u0445<\/a> \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B\" title=\"\u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b\">\u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a>, \u0432 \u0435\u0433\u043e \u0447\u0435\u0441\u0442\u044c \u0431\u044b\u043b \u0443\u0441\u0442\u0440\u043e\u0435\u043d \u0437\u0430\u0431\u0435\u0433 \u043c\u0435\u0436\u0434\u0443 \u041c\u0430\u0440\u0430\u0444\u043e\u043d\u043e\u043c \u0438 \u0410\u0444\u0438\u043d\u0430\u043c\u0438. \u0421 \u0442\u0435\u0445 \u043f\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B0%D1%84%D0%BE%D0%BD\" title=\"\u041c\u0430\u0440\u0430\u0444\u043e\u043d\">\u043c\u0430\u0440\u0430\u0444\u043e\u043d<\/a> \u0441\u0442\u0430\u043b \u043a\u043b\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0434\u0438\u0441\u0442\u0430\u043d\u0446\u0438\u0435\u0439, \u0438 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u043f\u043e \u043c\u0430\u0440\u0430\u0444\u043e\u043d\u0441\u043a\u043e\u043c\u0443 \u0431\u0435\u0433\u0443 \u0441\u0442\u0430\u043b\u0438 \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u0445 \u0432\u0438\u0434\u043e\u0432 \u043b\u0451\u0433\u043a\u043e\u0439 \u0430\u0442\u043b\u0435\u0442\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1185_%D0%B3%D0%BE%D0%B4\" title=\"1185 \u0433\u043e\u0434\">1185<\/a>&#160;\u2014 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0442\u043e\u043b\u043f\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B4%D1%80%D0%BE%D0%BD%D0%B8%D0%BA_I_%D0%9A%D0%BE%D0%BC%D0%BD%D0%B8%D0%BD\" title=\"\u0410\u043d\u0434\u0440\u043e\u043d\u0438\u043a I \u041a\u043e\u043c\u043d\u0438\u043d\">\u0410\u043d\u0434\u0440\u043e\u043d\u0438\u043a\u0430 I \u041a\u043e\u043c\u043d\u0438\u043d\u0430<\/a>. \u0414\u0438\u043d\u0430\u0441\u0442\u0438\u044f \u041a\u043e\u043c\u043d\u0438\u043d\u043e\u0432 \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u043b\u0430 \u043f\u0440\u0430\u0432\u0438\u0442\u044c \u0412\u0438\u0437\u0430\u043d\u0442\u0438\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1213_%D0%B3%D0%BE%D0%B4\" title=\"1213 \u0433\u043e\u0434\">1213<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9C%D1%8E%D1%80%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041c\u044e\u0440\u0435\">\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041c\u044e\u0440\u0435<\/a> \u043c\u0435\u0436\u0434\u0443 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%BD%D0%BE%D1%81%D1%86%D1%8B\" class=\"mw-redirect\" title=\"\u041a\u0440\u0435\u0441\u0442\u043e\u043d\u043e\u0441\u0446\u044b\">\u043a\u0440\u0435\u0441\u0442\u043e\u043d\u043e\u0441\u0446\u0435\u0432<\/a> \u0438 \u0430\u0440\u043c\u0438\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%B1%D0%B8%D0%B3%D0%BE%D0%B9%D1%81%D1%82%D0%B2%D0%BE\" class=\"mw-redirect\" title=\"\u0410\u043b\u044c\u0431\u0438\u0433\u043e\u0439\u0441\u0442\u0432\u043e\">\u0430\u043b\u044c\u0431\u0438\u0433\u043e\u0439\u0446\u0435\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1485_%D0%B3%D0%BE%D0%B4\" title=\"1485 \u0433\u043e\u0434\">1485<\/a>&#160;\u2014 \u0422\u0432\u0435\u0440\u0441\u043a\u0438\u0435 \u0431\u043e\u044f\u0440\u0435 \u043f\u0440\u0438\u0441\u044f\u0433\u0430\u044e\u0442 \u043d\u0430 \u0432\u0435\u0440\u043d\u043e\u0441\u0442\u044c \u0432\u0435\u043b\u0438\u043a\u043e\u043c\u0443 \u043a\u043d\u044f\u0437\u044e \u0418\u0432\u0430\u043d\u0443 III. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B2%D0%B5%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BD%D1%8F%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" class=\"mw-redirect\" title=\"\u0422\u0432\u0435\u0440\u0441\u043a\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e\">\u0422\u0432\u0435\u0440\u0441\u043a\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e<\/a> \u0432\u0445\u043e\u0434\u0438\u0442 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BD%D1%8F%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" class=\"mw-redirect\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1504_%D0%B3%D0%BE%D0%B4\" title=\"1504 \u0433\u043e\u0434\">1504<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1,_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%84%D0%BE%D1%80\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431, \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\">\u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440 \u041a\u043e\u043b\u0443\u043c\u0431<\/a> \u0432 \u0445\u043e\u0434\u0435 \u0447\u0435\u0442\u0432\u0451\u0440\u0442\u043e\u0433\u043e, \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0433\u043e, \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u044f \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u0438\u0437 \u0410\u043c\u0435\u0440\u0438\u043a\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044e<\/a>.<\/li><\/ul><h3>XVII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1624_%D0%B3%D0%BE%D0%B4\" title=\"1624 \u0433\u043e\u0434\">1624<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u0441\u0443\u0431\u043c\u0430\u0440\u0438\u043d\u0430 \u043f\u0440\u043e\u0448\u043b\u0430 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1643_%D0%B3%D0%BE%D0%B4\" title=\"1643 \u0433\u043e\u0434\">1643<\/a>&#160;\u2014 \u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043a\u043e\u043d\u0442\u0440\u0430\u043a\u0442\u0435 \u0411\u043b\u0438\u0441\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u0430\u0442\u0440\u0430 \u0443\u043f\u043e\u043c\u044f\u043d\u0443\u0442\u043e \u0438\u043c\u044f \u0430\u043a\u0442\u0451\u0440\u0430 \u0416\u0430\u043d\u0430-\u0411\u0430\u0442\u0438\u0441\u0442\u0430 \u041f\u043e\u043a\u043b\u0435\u043d\u0430 (\u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e \u0434\u0440\u0430\u043c\u0430\u0442\u0443\u0440\u0433\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D1%8C%D0%B5%D1%80\" title=\"\u041c\u043e\u043b\u044c\u0435\u0440\">\u041c\u043e\u043b\u044c\u0435\u0440\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1695_%D0%B3%D0%BE%D0%B4\" title=\"1695 \u0433\u043e\u0434\">1695<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>) \u043e\u0431\u0440\u0430\u0442\u0438\u043b\u0438\u0441\u044c \u043a \u0433\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440\u0443 \u0441 \u043f\u0440\u043e\u0441\u044c\u0431\u043e\u0439 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0432\u0435\u0440\u043e\u0438\u0441\u043f\u043e\u0432\u0435\u0434\u0430\u043d\u0438\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1698_%D0%B3%D0%BE%D0%B4\" title=\"1698 \u0433\u043e\u0434\">1698<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D1%86%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE\" class=\"mw-redirect\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u0446\u0430\u0440\u0441\u0442\u0432\u043e\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u043c \u0446\u0430\u0440\u0441\u0442\u0432\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B3%D0%B0%D0%BD%D1%80%D0%BE%D0%B3\" title=\"\u0422\u0430\u0433\u0430\u043d\u0440\u043e\u0433\">\u0422\u0430\u0433\u0430\u043d\u0440\u043e\u0433<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1699_%D0%B3%D0%BE%D0%B4\" title=\"1699 \u0433\u043e\u0434\">1699<\/a>&#160;\u2014 \u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u0440\u0443\u0441\u0441\u043a\u043e\u0435 \u0441\u0443\u0434\u043d\u043e \u043f\u043e\u0434 \u0442\u0440\u0451\u0445\u0446\u0432\u0435\u0442\u043d\u044b\u043c \u0444\u043b\u0430\u0433\u043e\u043c \u043f\u0440\u0438\u0431\u044b\u043b\u043e \u0437\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443 (\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\">\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c<\/a>).<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1715_%D0%B3%D0%BE%D0%B4\" title=\"1715 \u0433\u043e\u0434\">1715<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0451\u0442\u0440 I<\/a> \u0438\u0437\u0434\u0430\u043b \u0443\u043a\u0430\u0437, \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u0432\u0448\u0438\u0439 \u0436\u0438\u0442\u0435\u043b\u044f\u043c \u0441\u0442\u043e\u043b\u0438\u0446\u044b \u043f\u043e\u0434\u0431\u0438\u0432\u0430\u0442\u044c \u0441\u0430\u043f\u043e\u0433\u0438 \u0438 \u0431\u0430\u0448\u043c\u0430\u043a\u0438 \u0441\u043a\u043e\u0431\u0430\u043c\u0438 \u0438 \u0433\u0432\u043e\u0437\u0434\u044f\u043c\u0438. \u042d\u0442\u043e \u0431\u044b\u043b\u043e \u0441\u0434\u0435\u043b\u0430\u043d\u043e \u0441 \u0446\u0435\u043b\u044c\u044e \u0441\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0438\u044f \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u043e\u0433\u043e \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u044f \u0441\u0430\u043d\u043a\u0442-\u043f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0445 \u0443\u043b\u0438\u0446. \u0412 \u0443\u043a\u0430\u0437\u0435 \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u043e\u0441\u044c: \u00ab\u0410 \u0435\u0436\u0435\u043b\u0438 \u0443 \u043a\u043e\u0433\u043e \u0441 \u0442\u0430\u043a\u0438\u043c \u043f\u043e\u0434\u0431\u043e\u0435\u043c \u044f\u0432\u044f\u0442\u0441\u044f \u0441\u0430\u043f\u043e\u0433\u0438 \u0438\u043b\u0438 \u0431\u0430\u0448\u043c\u0430\u043a\u0438, \u0438 \u0442\u0435 \u0436\u0435\u0441\u0442\u043e\u043a\u043e \u0431\u0443\u0434\u0443\u0442 \u0448\u0442\u0440\u0430\u0444\u043e\u0432\u0430\u043d\u044b, \u0430 \u043a\u0443\u043f\u0435\u0447\u0435\u0441\u043a\u0438\u0435 \u043b\u044e\u0434\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0442\u0430\u043a\u0438\u0435 \u0441\u043a\u043e\u0431\u044b \u0438 \u0433\u0432\u043e\u0437\u0434\u0438 \u0434\u0435\u0440\u0436\u0430\u0442\u044c \u0431\u0443\u0434\u0443\u0442, \u0441\u043e\u0441\u043b\u0430\u043d\u044b \u0431\u0443\u0434\u0443\u0442 \u043d\u0430 \u043a\u0430\u0442\u043e\u0440\u0433\u0443; \u0430 \u0438\u043c\u0435\u043d\u0438\u0435 \u0438\u0445 \u0432\u0437\u044f\u0442\u043e \u0431\u0443\u0434\u0435\u0442\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1740_%D0%B3%D0%BE%D0%B4\" title=\"1740 \u0433\u043e\u0434\">1740<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u0438\u0445 \u043b\u0435\u0442 \u043f\u0435\u0440\u0435\u043f\u0438\u0441\u043a\u0438 \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D1%8C%D1%82%D0%B5%D1%80\" title=\"\u0412\u043e\u043b\u044c\u0442\u0435\u0440\">\u0412\u043e\u043b\u044c\u0442\u0435\u0440<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D0%B8)\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II (\u043a\u043e\u0440\u043e\u043b\u044c \u041f\u0440\u0443\u0441\u0441\u0438\u0438)\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u0412\u0435\u043b\u0438\u043a\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B0%D1%82,_%D0%96%D0%B0%D0%BD_%D0%9F%D0%BE%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u041c\u0430\u0440\u0430\u0442, \u0416\u0430\u043d \u041f\u043e\u043b\u044c\">\u0416\u0430\u043d \u041f\u043e\u043b\u044c \u041c\u0430\u0440\u0430\u0442<\/a> \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%80%D1%83%D0%B3_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%B0\" title=\"\u0414\u0440\u0443\u0433 \u043d\u0430\u0440\u043e\u0434\u0430\">\u0414\u0440\u0443\u0433 \u043d\u0430\u0440\u043e\u0434\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799_%D0%B3%D0%BE%D0%B4\" title=\"1799 \u0433\u043e\u0434\">1799<\/a>&#160;\u2014 \u0428\u0435\u0439\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%80%D0%B1%D0%B5%D0%BD%D1%82\" title=\"\u0414\u0435\u0440\u0431\u0435\u043d\u0442\">\u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD\" title=\"\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\">\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d<\/a>) \u0410\u043b\u0438-\u0445\u0430\u043d \u043f\u0440\u0438\u043d\u044f\u0442 \u0432 \u0440\u0443\u0441\u0441\u043a\u043e\u0435 \u043f\u043e\u0434\u0434\u0430\u043d\u0441\u0442\u0432\u043e.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1817_%D0%B3%D0%BE%D0%B4\" title=\"1817 \u0433\u043e\u0434\">1817<\/a>&#160;\u2014 \u0412 \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 I<\/a> \u0432 \u041c\u0438\u0442\u0430\u0432\u0435 (\u043d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B3%D0%B0%D0%B2%D0%B0\" title=\"\u0415\u043b\u0433\u0430\u0432\u0430\">\u0415\u043b\u0433\u0430\u0432\u0430<\/a>) \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e\u0431 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u0438 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u041a\u0443\u0440\u043b\u044f\u043d\u0434\u0438\u044f\">\u041a\u0443\u0440\u043b\u044f\u043d\u0434\u0438\u0438<\/a>. \u042d\u0442\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0435\u043c 25&#160;\u0430\u0432\u0433\u0443\u0441\u0442\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/6_%D1%81%D0%B5%D0%BD%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"6 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f\">6 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1858_%D0%B3%D0%BE%D0%B4\" title=\"1858 \u0433\u043e\u0434\">1858<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>) \u043e\u0442\u043a\u0440\u044b\u0442\u043e \u0437\u043e\u043b\u043e\u0442\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1890_%D0%B3%D0%BE%D0%B4\" title=\"1890 \u0433\u043e\u0434\">1890<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0430\u043c\u0438 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0433\u043e\u0440\u043e\u0434 \u0421\u043e\u043b\u0441\u0431\u0435\u0440\u0438 (\u043d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D0%B0%D1%80%D0%B5\" title=\"\u0425\u0430\u0440\u0430\u0440\u0435\">\u0425\u0430\u0440\u0430\u0440\u0435<\/a>, \u0441\u0442\u043e\u043b\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%B1%D0%B0%D0%B1%D0%B2%D0%B5\" title=\"\u0417\u0438\u043c\u0431\u0430\u0431\u0432\u0435\">\u0417\u0438\u043c\u0431\u0430\u0431\u0432\u0435<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82\" title=\"\u041a\u0438\u0435\u0432\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\">\u041a\u0438\u0435\u0432\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BB%D1%8C%D1%8F%D0%BD%D0%BE%D0%B2%D1%81%D0%BA\" title=\"\u0423\u043b\u044c\u044f\u043d\u043e\u0432\u0441\u043a\">\u0421\u0438\u043c\u0431\u0438\u0440\u0441\u043a<\/a> \u043e\u0442\u0431\u0438\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D0%BE%D1%87%D0%B5-%D0%BA%D1%80%D0%B5%D1%81%D1%82%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0420\u0430\u0431\u043e\u0447\u0435-\u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0430\u0