u0435\u043d\u0431\u0435\u0440\u0433\u043e\u043c<\/a>, \u043f\u043e\u0431\u0435\u0434\u0438\u043b\u0430 \u043d\u0430 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82_%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u041d\u043e\u0440\u0432\u0435\u0433\u0438\u0438\">\u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u041d\u043e\u0440\u0432\u0435\u0433\u0438\u0438<\/a>, \u0437\u0430\u043d\u044f\u0432 87 \u0438\u0437 169 \u043c\u0435\u0441\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2006_%D0%B3%D0%BE%D0%B4\" title=\"2006 \u0433\u043e\u0434\">2006<\/a>&#160;\u2014 \u0412 \u0440\u0430\u043c\u043a\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D0%BD%D0%B5_%D0%9C%D0%B0%D0%B4%D0%BE%D0%BD%D0%BD%D1%8B#Confessions_Tour\" title=\"\u0422\u0443\u0440\u043d\u0435 \u041c\u0430\u0434\u043e\u043d\u043d\u044b\">Confessions Tour<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B4%D0%BE%D0%BD%D0%BD%D0%B0_(%D0%BF%D0%B5%D0%B2%D0%B8%D1%86%D0%B0)\" title=\"\u041c\u0430\u0434\u043e\u043d\u043d\u0430 (\u043f\u0435\u0432\u0438\u0446\u0430)\">\u041c\u0430\u0434\u043e\u043d\u043d\u0430<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043f\u043e\u0441\u0435\u0442\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044e<\/a>, \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043d\u0430 \u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0435 \u041b\u0443\u0436\u043d\u0438\u043a\u0438.<\/li><li><a href=\"htt